void ConvolutionBlock(SequentialType* baseLayer,
                   	  const size_t inSize,
                       	   const size_t outSize,
                            const size_t strideWidth,
                            const size_t strideHeight,
                            const size_t kernelWidth,
                            const size_t kernelHeight,
                            const size_t padW = 0,
                            const size_t padH = 0,
                            const bool downSample = false,
                            const size_t downSampleInputWidth = 0,
                            const size_t downSampleInputHeight = 0)
{

	if (downsample)
	{
		inputWidth = downSampleInputWidth;
		inputHeigt = downSampleInputHeight;
	}

	baseLayer->Add(new ann::Convolution<>(inSize, outSize, kernelWidth,
           kernelHeight, strideWidth, strideHeight, padW, padH,
           inputWidth, inputHeight));
	baseLayer->Add(new ann::BatchNorm<>(outSize, 1e-5));
	// Updating input dimensions.
	inputWidth = ConvOutSize(inputWidth, kernelWidth, strideWidth, padW);
	inputHeight = ConvOutSize(inputHeight, kernelHeight, strideHeight, padH);	
}
```
If correctly parameters are passed this is all that is required to implement all blocks. This reduced about 50 or so lines or redundant code. Always a single function would be called with different params.', 'comment_created': datetime.datetime(2021, 6, 30, 16, 6, 57, tzinfo=datetime.timezone.utc), 'commenter': 'kartikdutt18', 'type': 'User'}, {'comment_id': 661619863, 'comment_body': '> Yup Sure, Do you want to discuss that over a call? that way it would be more clear to me.

